import React, { Component } from 'react';
import { BrowserRouter as Router } from "react-router-dom";
import Switch from "react-router-dom/es/Switch";
import Route from "react-router-dom/es/Route";
import LoginForm from "./LoginForm";
import ListProjectComponent from "./ListProjectComponent";
import {Menu} from "antd";

class StudentPage extends Component{
    render() {
        return (
            <Router>
                <Switch>
                    <Route path="/student/projects" exact component={ListProjectComponent} />
                    <Route path="/student" exact component={LoginForm} />
                    <Menu  className="Top-bar" onClick={this.handleClick} selectedKeys={[this.state.current]} mode="horizontal">
                        <Menu.Item key="profile" icon={<MailOutlined />}>
                            Navigation One
                        </Menu.Item>
                        <Menu.Item key="mail" icon={<MailOutlined />}>
                            Navigation One
                        </Menu.Item>
                        <Menu.Item key="xxxx" icon={<MailOutlined />}>
                            Navigation One
                        </Menu.Item>
                    </Menu>
                </Switch>
            </Router>
        )
    }
}

export default StudentPage;
